import React from "react";
import "./Navbar.css";

const Navbar = props => (

    <nav>
        <div className="nav nav-bar">


      <div> {props.rightWrong}</div> 
      <div className="current-score">Current Score: {props.score}</div> 
      <div>  High Score: {props.highscore}</div> 

        </div>
    </nav>
)
export default Navbar;
